import React from "react";

const Form = () => {
    return (
        <form>
            <select>
                <option value="moscow">Moscow</option>
                <option value="saint-peterburg">Saint-Peterburg</option>
                <option value="kiev">Kiev</option>
                <option value="minsk">Minsk</option>
            </select>
            <button>Узнать погоду</button>
        </form>
    );
};

export default Form;
